-- ----------------------------
-- Table structure for sys_menu_resource
-- ----------------------------
CREATE TABLE `sys_menu_resource`  (
  `menu_resource_id` bigint NOT NULL COMMENT '主键',
  `business_type` int NOT NULL COMMENT '绑定资源的类型，1：菜单，2：菜单下按钮',
  `business_id` bigint NOT NULL COMMENT '菜单或按钮id',
  `resource_code` varchar(300) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL DEFAULT 'N' COMMENT '资源的编码',
  `create_time` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `create_user` bigint NULL DEFAULT NULL COMMENT '创建人',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '修改时间',
  `update_user` bigint NULL DEFAULT NULL COMMENT '修改人',
  PRIMARY KEY (`menu_resource_id`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '菜单资源绑定' ROW_FORMAT = Dynamic;

